import styled from 'styled-components';


const Input = styled.input`
    order: 1px solid #FFF;
    background: transparent;
    border: 1px solid #FFF;
    padding: 20px 140px;
    border-radius: 20px;
    width: 200px;
    font-size: 20px;
    margin-bottom: 10px;
    // color: #000;

    &::placeholder {
            color: #FFF;
            font-size: 16px;
    }
`;

export default Input;
